INSERT INTO `custom_emails` VALUES (1,'new_password',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Reset Password','<p>Dear, [first_name] [last_name]</p><p>You have reset your password.</p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Password Reset'),(2,'welcome_email',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Welcome to [company_name]','<p>[first_name]</p>\n            <p>Congratulations on registering with [company_name]! You can now log in with\n            your email address and chosen password.\n            <a href=\" http://core-ds.cplocal/login\" target=\"_blank\">[company_name]</a></p>\n            <p><br></p><p><br></p><p><br></p>\n            <p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Welcome Email'),(3,'new_rep',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','New rep at [company_name]','<p>[company_name]</p><p>You have a new user, [first_name] [last_name].</p><p><br></p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Sponsor Notice new Rep'),(4,'sponsor_notice',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Sponsor Notice','<p>[sponsor_first_name]</p>\n            <p>Congratulations a new user has registered with Chalk Couture and you are their sponsor!</p>\n            <p>New Rep\'s contact info</p>\n            <p>Name: [first_name] [last_name]</p><p>Phone: [phone]</p><p>Email: [email]</p><p><br></p>\n            <p><br></p><p><br></p><p><br></p><p style=\'text-align: center;\'>[back_office_logo]</p>\n            <p style=\'text-align: center;\'>This is an important notification from [company_name]</p>\n            <p style=\'text-align: center;\'>[company_name] [company_address]</p>','Sponsor Notice new Rep'),(5,'invoice',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Invoice','<p>Hi [first_name],</p>\n            <p>Thanks for placing an order with [company_name]. We are currently waiting to receive your\n            payment to complete your order.</p>\n            <p><a href=\"http://[invoice_url]\"\n            target=\"_blank\">http://[invoice_url]</a> Click here to view order</p>\n            <p>User:  [first_name] [last_name]</p>\n            <p>Amount: [amount]</p>\n            [note]\n            <p>Review this order details. If you have any question or concerns,\n            please do not hesitate to contact customer support.</p>\n            <p><br></p><p><br></p><p><br></p>\n            <p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Invoice'),(6,'fulfilled',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Order Shipped','<p>Dear [first_name],</p>\n            <p>We are pleased to inform you that the following order has shipped</p>\n            <p>[orderlines]</p>\n            <p>Subtotal Price: [order_subtotal]</p>\n            <p>Discount: [order_discount]</p>\n            <p>Tax: [order_tax]</p>\n            <p>Shipping: [order_shipping]</p>\n            <p>Total Price: [order_total]</p>\n            <p><br></p><p><br></p><p><br></p>\n            <p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Order Fulfilled'),(7,'new_order_received',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','You Have an New Order!','<p>Dear [first_name],</p>\n            <p>Congratulations! You just sold an item! Here are the details from this order:</p>\n            <p>Order ID: [order_receipt_id]</p>\n            <p>Purchaser Name: [customer_first_name] [customer_last_name]</p>\n            <p>Purchaser Email: [customer_email]</p><p>[orderlines]</p><p><br></p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Order Received FBC'),(8,'fbc_order_received',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','FBC Order','<p>Dear [first_name] [last_name]</p>\n            <p>We wanted to let you know that one or more of your fulfilled by corporate items has\n            been sold on Chalk Couture Congratulations! You are not required to take any action for this order.\n            &nbsp;If you would like to view the details of this transaction, please sign in to your back office.</p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Order Received FBC'),(9,'order_receipt',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Order [order_receipt_id]','<p>[company_name] Receipt</p>\n            <p>Order Number: [order_receipt_id]</p>\n            <p>Hi [first_name],</p><p>We are currently getting your order ready to be shipped.\n            We will notify you when it has been sent.</p>\n            <p>Your Order Details</p><p>[orderlines]</p>\n            <p>Subtotal Price: [order_subtotal]</p>\n            <p>Discount: [order_discount]</p>\n            <p>Tax: [order_tax]</p>\n            <p>Shipping: [order_shipping]</p>\n            <p>Total Price: [order_total]</p>\n            <p><br></p><p>If you have any questions or concerns, please don\'t hesitate to\n            contact customer support.</p>\n            <p><br></p><p><br></p><p><br></p><p style=\'text-align: center;\'>[back_office_logo]</p>\n            <p style=\'text-align: center;\'\'>This is an important notification from [company_name]</p>\n            <p style=\'text-align: center;\'>[company_name] [company_address]</p>','Order Receipt'),(10,'card_update',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Subscription Expired','<p>Dear [first_name] [last_name],</p>\n            <p>Your credit card on file needs to be updated.&nbsp;</p>\n            <p>If this is not done soon you will be locked out of the system.</p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Subscription Failed'),(11,'missing_card',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','No Card on File','<p>Dear [first_name] [last_name],</p>\n            <p>You do not have a credit card on file for your subscription</p>\n            <p><br></p><p><br></p><p><br></p><p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Missing Card'),(12,'renew_fail',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Subscription Failed','<p>[first_name] [last_name],</p>\n                <p>We\'ve sent this email to inform you that your auto-renewal of your&nbsp;subscription has failed.\n                Your subscription ended on [billing_date]</p>\n                <p>The reason was logged as the following: </p><p>[reason]</p>\n                <p>Please ensure that all of your information in your account is up to date. If you would like,\n                 you may sign in to your account and renew it using a different credit card. Please be\n                 aware that doing so will mean that future subscription renewals will be charged to that card.</p>\n                <p><br></p><p><br></p><p><br></p><p style=\'text-align: center;\'\'>[back_office_logo]</p>\n                <p style=\'text-align: center;\'>This is an important notification from [company_name]</p>\n                <p style=\'text-align: center;\'>[company_name] [company_address]</p>','Subscription Failed'),(13,'renew_success',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Subscription Renewed Successfully','<p>Dear [first_name] [last_name],</p>\n            <p>We\'ve sent this email to inform you that your auto-renewal of your&nbsp;\n            subscription has succeeded.</p><p><br></p>\n            <p><br></p><p><br></p><p><br></p>\n            <p style=\'text-align: center;\'>[back_office_logo]</p>\n            <p style=\'text-align: center;\'>This is an important notification from [company_name]</p>\n            <p style=\'text-align: center;\'>[company_name] [company_address]</p>','Subscription Renewed Successfully'),(14,'expire_notice',1,'2018-04-05 23:19:19','2018-04-05 23:19:19','Subscription Renewed Notice','<p>Dear [first_name] [last_name],</p>\n            <p>Your subscription will be renewed on [billing_date]</p><p><br></p>\n            <p><br></p><p><br></p><p><br></p>\n            <p style=\"text-align: center;\">[back_office_logo]</p>\n            <p style=\"text-align: center;\">This is an important notification from [company_name]</p>\n            <p style=\"text-align: center;\">[company_name] [company_address]</p>','Subscription Renewed Notice');
