CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `transaction_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `customer_id` int(11) NOT NULL,
  `store_owner_user_id` int(11) NOT NULL,
  `receipt_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `type_id` int(11) NOT NULL,
  `total_price` double(8,2) NOT NULL,
  `subtotal_price` double(8,2) NOT NULL,
  `total_tax` double(8,2) NOT NULL,
  `total_shipping` double(8,2) NOT NULL,
  `shipping_rate_id` int(11) NOT NULL,
  `total_discount` double(8,2) NOT NULL,
  `paid_at` timestamp NULL DEFAULT NULL,
  `cash` tinyint(1) NOT NULL,
  `source` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT 'unfulfilled',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `taxes_committed` tinyint(1) NOT NULL DEFAULT '0',
  `comm_engine_status_id` int(11) NOT NULL DEFAULT '1',
  `gateway_reference_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `tax_not_charged` tinyint(1) NOT NULL,
  `buyer_first_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `buyer_last_name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `pid` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  `buyer_pid` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  `buyer_email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `seller_pid` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  `seller_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `confirmation_code` varchar(16) COLLATE utf8_unicode_ci DEFAULT NULL,
  `coupon_id` int(10) unsigned DEFAULT NULL,
  `billing_address` text COLLATE utf8_unicode_ci,
  `shipping_address` text COLLATE utf8_unicode_ci,
  `tax_invoice_pid` varchar(25) COLLATE utf8_unicode_ci DEFAULT NULL,
  `inventory_received_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `orders_customer_id_index` (`customer_id`),
  KEY `orders_store_owner_user_id_index` (`store_owner_user_id`),
  KEY `orders_receipt_id_index` (`receipt_id`),
  KEY `orders_status_index` (`status`),
  KEY `orders_created_at_index` (`created_at`),
  KEY `orders_updated_at_index` (`updated_at`),
  KEY `orders_transaction_id_index` (`transaction_id`),
  FULLTEXT KEY `orders_search_index` (`receipt_id`,`buyer_first_name`,`buyer_last_name`),
  CONSTRAINT `orders_status_foreign` FOREIGN KEY (`status`) REFERENCES `order_status` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=205 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
